import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class Register extends Component {
    constructor() {
        super();
        this.state = {
            username: "",
            email: "",
            password: "",
            password2: "",
            errors: {}
        }
    }

    //kalo form diberi :
    onSubmit = e => {
        e.preventDefault();
    }
}

export default Register;
